import "./styles.css";
import { ListGroup, ListGroupItem } from "reactstrap";
import "bootstrap/dist/css/bootstrap.css";

function TodoList1() {
  return (
    <ListGroup>
      <ListGroupItem
        tag="a"
        href="#"
        className="align-self-center py-2 w-50 bg-info text-white"
      >
        Cook Breakfast
      </ListGroupItem>
      <ListGroupItem
        tag="a"
        href="#"
        className="align-self-center py-2 w-50 bg-info text-white"
      >
        Walk Dog
      </ListGroupItem>
      <ListGroupItem
        tag="a"
        href="#"
        className="align-self-center py-2 w-50 bg-info text-white"
      >
        Take Shower
      </ListGroupItem>
    </ListGroup>
  );
}

function TodoList2() {
  return (
    <ListGroup>
      <ListGroupItem
        tag="a"
        href="#"
        className="align-self-center py-2 w-50 bg-info text-white"
      >
        Get Lunch
      </ListGroupItem>
      <ListGroupItem
        tag="a"
        href="#"
        className="align-self-center py-2 w-50 bg-info text-white"
      >
        Run a Mile
      </ListGroupItem>
      <ListGroupItem
        tag="a"
        href="#"
        className="align-self-center py-2 w-50 bg-info text-white"
      >
        Take Bath
      </ListGroupItem>
    </ListGroup>
  );
}

function TodoList3() {
  // Wednesday's Todo List
  return (
    <ListGroup>
      <ListGroupItem
        tag="a"
        href="#"
        className="align-self-center py-2 w-50 bg-info text-white"
      >
        Attempt to break a world record
      </ListGroupItem>
      <ListGroupItem
        tag="a"
        href="#"
        className="align-self-center py-2 w-50 bg-info text-white"
      >
        Write a haiku about your favorite food
      </ListGroupItem>
      <ListGroupItem
        tag="a"
        href="#"
        className="align-self-center py-2 w-50 bg-info text-white"
      >
        Learn to juggle
      </ListGroupItem>
    </ListGroup>
  );
}

function TodoList4() {
  // Thursday's Todo List
  return (
    <ListGroup>
      <ListGroupItem
        tag="a"
        href="#"
        className="align-self-center py-2 w-50 bg-info text-white"
      >
        Make a DIY lava lamp
      </ListGroupItem>
      <ListGroupItem
        tag="a"
        href="#"
        className="align-self-center py-2 w-50 bg-info text-white"
      >
        Invent a new dance move
      </ListGroupItem>
      <ListGroupItem
        tag="a"
        href="#"
        className="align-self-center py-2 w-50 bg-info text-white"
      >
        Draw a portrait of your pet
      </ListGroupItem>
    </ListGroup>
  );
}

function TodoList5() {
  // Friday's Todo List
  return (
    <ListGroup>
      <ListGroupItem
        tag="a"
        href="#"
        className="align-self-center py-2 w-50 bg-info text-white"
      >
        Have a living room karaoke session
      </ListGroupItem>
      <ListGroupItem
        tag="a"
        href="#"
        className="align-self-center py-2 w-50 bg-info text-white"
      >
        Create a new superhero with unique powers
      </ListGroupItem>
      <ListGroupItem
        tag="a"
        href="#"
        className="align-self-center py-2 w-50 bg-info text-white"
      >
        Bake cookies in the shape of 
      </ListGroupItem>
    </ListGroup>
  );
}

function TodoList6() {
  // Saturday's Todo List
  return (
    <ListGroup>
      <ListGroupItem
        tag="a"
        href="#"
        className="align-self-center py-2 w-50 bg-info text-white"
      >
        Organize a themed costume party
      </ListGroupItem>
      <ListGroupItem
        tag="a"
        href="#"
        className="align-self-center py-2 w-50 bg-info text-white"
      >
        Watch a movie in reverse
      </ListGroupItem>
      <ListGroupItem
        tag="a"
        href="#"
        className="align-self-center py-2 w-50 bg-info text-white"
      >
        Build a pillow fort
      </ListGroupItem>
    </ListGroup>
  );
}

function TodoList7() {
  // Sunday's Todo List
  return (
    <ListGroup>
      <ListGroupItem
        tag="a"
        href="#"
        className="align-self-center py-2 w-50 bg-info text-white"
      >
        Have a picnic in your living room
      </ListGroupItem>
      <ListGroupItem
        tag="a"
        href="#"
        className="align-self-center py-2 w-50 bg-info text-white"
      >
        Create a home obstacle course
      </ListGroupItem>
      <ListGroupItem
        tag="a"
        href="#"
        className="align-self-center py-2 w-50 bg-info text-white"
      >
        Host a family talent show
      </ListGroupItem>
    </ListGroup>
  );
}

export default function App() {
  let d = new Date();
  let day = [
    "Sunday",
    "Monday",
    "Tuesday",
    "Wednesday",
    "Thursday",
    "Friday",
    "Saturday",
  ];
  let n = day[d.getDay()];

  let todo;

  if (n === "Monday") {
    todo = <TodoList1 />;
  } else if (n === "Tuesday") {
    todo = <TodoList2 />;
  } else if (n === "Wednesday") {
    todo = <TodoList3 />;
  } else if (n === "Thursday") {
    todo = <TodoList4 />;
  } else if (n === "Friday") {
    todo = <TodoList5 />;
  } else if (n === "Saturday") {
    todo = <TodoList6 />;
  } else if (n === "Sunday") {
    todo = <TodoList7 />;
  }

  return (
    <div className="App">
      <h1>
        <span className="d-flex justify-content-center text-warning">
          {n}'s
        </span>
        Todo List
      </h1>
      {todo}
    </div>
  );
}
